INSERT INTO `corporiation` VALUES (56, '上海炫亮', '上海市漕河泾新兴技术开发区田林路487号宝石园大厦20号楼1008/1009室', '公司成立于2004年8月（前身是2003年7月成立的点亮科技）,公司成立十年来，发展稳健、客户口碑优良。\n发展\n特别最近两年公司开始全面转型游戏行业，依靠技术优势、业务发展迅猛，已经成功商用多款优秀健康的游戏，特别在手游行业已有一定的知名度和美誉度。 公司愿景希望通过自身的努力，脚踏实地，力争快速跨入最优秀的游戏研发商的行列', '徐张萍/王璐', 'HR', '', '', '18317958868', '296178778/1032744735', '', '否', '否', 0, 0, '2019-12-19', 21, -1, NULL);
INSERT INTO `corporiation` VALUES (57, '砾阳软件', '上海浦东新区张江路185号', '上海砾阳软件有限公司于2003年3月成立于上海市科技创业中心，先后被认定为国家高新技术企业，上海市软件企业，专注于向国内客户提供高端金融IT服务和移动互联网应用产品的研发。 砾阳软件为总部位于上海的中国最大股份制商业银行交通银行持续稳定地提供了12年以上的软件服务，同时砾阳软件的移动互联网应用产品在辉瑞中国、惠氏中国、强生中国、雅培中国等世界五百强企业得到广泛应用。 砾阳软件拥有独立的技术研发中心，拥有一支专业从事金融软件开发、移动互联网应用开发、大数据分析、互联网金融、云计算等技术的精英研发团队，进行尖端技术研发，并取得了多项软件产品著作权，能够快速准确的为客户提供专业、全面的系列解决方案及服务.....', '', '人事', '', '58550400', '', '441641183/441641183', '', '否', '否', 0, 0, '2019-12-19', 21, -1, NULL);
