INSERT INTO `corporiation` VALUES (60, '上海绿度信息科技股份有限公司', '万科七宝国际广场20号楼808室', '是一家专业的物联网与移动互联网公司，目前，公司在农业物联网和农业信息化领域中，先后承建了国家工信部、上海经信委、科委、农委等多项国家（地区）农业信息化科技应用项目。绿度自主研发的“食品安SAAS营销追溯系统”、“省市县三级食品安全监管平台”、“农村综合信息服务平台”、“农产品电子商务平台”、“农产品追溯监管公众平台”、“大田农情监测系统”、“精准农业自动化系统”等产品，为各级政府与企业提供了农业信息化建设的一体化解决方案。', '陈先生', '技术经理', '', '02153752072_', '', '2601183227', '', '否', '否', 0, 0, '2019-12-19', 21, -1, NULL);
