INSERT INTO `corporiation` VALUES (63, '上海览逸信息科技有限公司', '上海市徐汇区文定路200号盛源恒华大厦903-905室', '　　上海览逸信息科技有限公司成立于2010年4月，是上海市认定的双软企业和国家认定的高新技术企业，公司成立宗旨是立足于证券期货行业，提供先进的证券期货行业资产管理系统、交易终端及联合风控为一体的解决方案，成为证券期货行业专业的技术提供商和运营服务合作商。\n ', '顾小姐', 'HR', '', '021-60490374', '', '3228154004', '', '否', '否', 0, 0, '2019-12-19', 21, -1, NULL);
INSERT INTO `corporiation` VALUES (64, '软通动力', '上海市浦东新区金苏路200号H栋5楼/南京市江宁区淳化街道芝兰路江宁大学城/上海浦东新区金苏路200号H栋5楼', '软通动力信息技术（集团）有限公司成立于2001年，现已发展成为领先的、全方位IT服务及行业解决方案提供商。业务范围涵盖IT咨询及解决方案、应用开发及维护、软件产品工程、网络/基础设施服务以及业务流程外包（BPO）服务等，是金融、电信/高科技、能源/交通/公用事业等行业重要的IT综合服务提供商和战略合作伙伴。', '谢芸芸/周小姐/叶红美 /李曼/毕建树/蔡斌 ', '人事招聘/人事经理/项目经理', '', '021-60351919-6809/021-60351919-6841', '/18012958760/13817442876/18712598813/', '/992245726/微信', '', '否', '否', 0, 0, '2019-12-19', 21, -1, NULL);
INSERT INTO `corporiation` VALUES (65, '才聚企业管理服务（上海）有限公司', '外高桥', '才聚企业管理服务（上海）有限公司是一家专业的设施管理外包服务公司(Integrated Facility Management) , 核心团队都曾在500强外资企业担任高级管理职位，具备国际化的视野和专业化的运作能力，目前业务覆盖全国，主要为知名外企和国内企业提供设施管理、物业管理、能源管理等专业服务。\n', '周小姐', '人事', '', '021-32030136', '', '1256206738', '', '否', '否', 0, 0, '2019-12-19', 21, -1, NULL);
INSERT INTO `corporiation` VALUES (66, '上海阳关网络信息技术有限公司', '上海市东方路3539号2号楼2508室', '上海阳关网络信息技术有限公司（SunGate）是一家专业从事企业安全生产信息化管理软件开发并通过“双软”认证的本土IT企业。公司积极开展企业管理软件的自主研发,包括安全生产标准化软件、HSE软件、QHSE软件、工作流应用等。公司的知名客户覆盖上市公司、外企、大型企业以及电信运营商。\n', '刘莹', '人事招聘', '', '021-61633563-8008', '', 'QQ2851196366', '', '否', '否', 0, 0, '2019-12-19', 21, -1, NULL);
INSERT INTO `corporiation` VALUES (67, '上海世纪互联信息系统有限公司', '黄浦区丽园路501号A2楼\n', '上海世纪互联信息系统有限公司是由北京著名独立电信运营商世纪互联数据中心有限公司的上海分公司通过管理层回购（MBO）转制而成的。。\n\n上海世纪互联不仅聚集了国内最早一代的ISP创业精英，而且吸纳了数名海外华人背景的资深专业管理人员，更有一批来自国际著名IT厂商的中高层专业人士。凭着对国内市场的熟悉、先进的管理经验和不断进取的精神，上海世纪互联已经成为行业中的重量级供应商。', '聂小姐', '人事招聘', '', '021-63015500', '', 'QQ496191998', '', '否', '否', 0, 0, '2019-12-19', 21, -1, NULL);
