INSERT INTO `corporiation` VALUES (72, '北京宇信易诚', '浦东新区福山路33号建工大厦22楼C座\n4号线浦东大道站（3号口）下车，步行至公司/上海市闵行区莲花路2080弄50号E幢808室/中国上海 上海市浦东新区上海市浦东新区1880弄61号610室/', '宇信科技是国内规模最大的银行IT解决方案提供商之一，主要从事向以银行为主的金融机构提供包括咨询、软件产品、软件开发和实施、运营维护、系统集成等信息化服务。公司总部位于北京，在全国拥有27家控股子公司和11家参股企业，集团员工总人数达6600余人。', '郝小姐', '人事', '', '02158777728', '', '', '', '否', '否', 0, 0, '2019-12-19', 21, -1, NULL);
INSERT INTO `corporiation` VALUES (73, '米道科技', '上海市普陀区武威路88弄中鑫企业广场一号楼三层', '上海米道信息科技有限公司 自成立以来一直致力于为制造业提供领先的EQMS、APS、WMS、MES产品，制定解决方案及管理咨询等信息化整体解决方案。 公司拥有一批技术全面的研发人员和经验丰富的管理人员，其中多位行业专家顾问都是业内顶尖人员。在规范化管理过程中形成了米道独有的产品研发和管理咨询模式，逐渐发展成具有一定规模的企业信息化管理咨询公司', '陈先生', '技术经理', '', '02153752072_', '', '2601183227', '', '否', '否', 0, 0, '2019-12-19', 21, -1, NULL);
