INSERT INTO `corporiation` VALUES (502, '上海客趣计算机科技有限公司', '黄浦区云南南路261号609', '技能要求： 直播，技术，项目，商务 岗位职责描述：  1、负责直播及网络会议的现场环境的搭建与直播期间的支持和维护，尤其是医疗、医学相关的直播 2、负责直播及网络会议项目的现场执行以及后台互动的工作，确保每一场直播的质量和效率 3、负责直播及网络会议前期和客户及第三方进行现场环境，设备搭建情况的调试与沟通，直播结束后回放的剪辑上线     公司简介：      上海客趣(Cache) 计算机科技有限公司主要从事医药领域的患者管理、网络推广、软件开发、市场咨询等服务。拥有来自各个领域的研究与执行专家。我们的目标是在健康产业的市场及销售领域（产品与服务），为客户提供完整的商务资讯及解决方案。自2005年以来，客趣计算机已经为很多医药及其他公司提供了专业的服务。        我公司秉持“诚信，创新，服务，发展”的经营理念，不断的根据市场变化和行业技术的最新发展动态，精心地为客户提供最少投资、最大收益的全面解决方案。   4-5K', '彭老师', 'HR', '', '', '', '', 'wxid_i7fxlys56phi22', '否', '否', 0, 0, '2020-01-14', 22, 22, NULL);
